import { NavLink } from 'react-router-dom'
const Item = ({disco}) => {

	return (

		<div key={disco.id}>
			<p><strong>{disco.artist}</strong></p>
			<p>{disco.record}</p>
			<img style={{width: "140px"}} src={`/${disco.img}`} alt={`${disco.artist} - ${disco.record}`} />

			<NavLink to={`/item/${disco.id}`} className="button-link">Ver detalles</NavLink>

		</div>
	)
}

export default Item
